 import style from "./Home.module.css";
 import pic1 from "../../images/1.png";
 import pic2 from "../../images/2.2.jfif";
 import pic3 from "../../images/2.3.jfif";

 import {NavLink} from "react-router-dom";


    
    function Home(){
        return(
            <>
            <div id="">

            
               <div id={style.header}>
                   <div id={style.headerHeadingBox}>
                        <h3>Online Exam System</h3> 
                    </div>
                </div>

              <div id={style.div1}>
                  <img src={pic1} alt="" />
                  {/* <span>Online Exam</span> */}
              </div>


              <div id={style.div2}>
            
                  <div className ={style.div3}>
                  <span>Student</span>
                     <NavLink exact  to="/StudentLogin">
                        <img src={pic2} alt="" />
                       
                     </NavLink>
                  </div>

                  <div  className ={style.div3}>
                  <span>Admin</span>
                    <NavLink  to="/AdminLogin">
                       <img src={pic3} alt="" />
                       
                     </NavLink> 
                  </div>
                
              </div>


              </div>

            </>
        );
    }

     

    export default Home;
